import React from "react";
import "./Navbar.css";
import { FaSearch, FaUsers, FaChartBar, FaEnvelope, FaUserPlus, FaUserCircle } from "react-icons/fa";

const Navbar = () => {
  return (
    <nav className="navbar">
      {/* Left side: Logo */}
      <div className="nav-left">
        <img src="/images/zidio-logo.png" alt="Zidio Logo" className="logo" />
      </div>

      {/* Center: Icons */}
      <div className="nav-center">
        <FaSearch className="nav-icon" title="Search" />
        <FaUsers className="nav-icon" title="People" />
        <FaChartBar className="nav-icon" title="Reports" />
        <FaEnvelope className="nav-icon" title="Messages" />
        <FaUserPlus className="nav-icon" title="Invite" />
      </div>

      {/* Right side: User Profile */}
      <div className="nav-right">
        <FaUserCircle className="user-icon" title="User Profile" />
      </div>
    </nav>
  );
};

export default Navbar;
